import React from 'react'
import TableComponentDetails from './TableComponentdetails'
import TableComponentSteps from './TableComponentSteps'
import '../component_style/viewexercise_style.css'

function ViewExercise(props) {
    const stepsData = ['Row 1 Content', 'Row 2 Content', 'Row 3 Content'];
    const tableData = [
        { column1: 'Row 1, Column 1', column2: 'Row 1, Column 2' },
        { column1: 'Row 2, Column 1', column2: 'Row 2, Column 2' },
        { column1: 'Row 3, Column 1', column2: 'Row 3, Column 2' },
      ];
  return (
    <div className='exercise-container'>
        <div className='image-description-container'>
            <h1>{props.data.details.name}</h1>
            <img src='https://fitnessprogramer.com/wp-content/uploads/2023/02/warm-up-exercises.png' alt='Exercise' className='exercise-image'/>
        </div>
        <TableComponentDetails tableData={props.data.details}/>
        <TableComponentSteps tableData={props.data.details.steps}/>
    </div>
  )
}

export default ViewExercise;
